INSERT INTO `ysk_wenzhang` VALUES ('13', '联系客服', '&lt;h1 style=&quot;text-align:justify&quot;&gt;温馨提示&lt;/h1&gt;\r\n\r\n&lt;p style=&quot;text-align:justify&quot;&gt;您要充值的信息要准确填写账号；注册时的昵称；手机号码和充值金额。&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align:justify&quot;&gt;有必要时请及时联系客服专员。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align:center&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;/Uploads/image/goods_description/2018-01-22/5a6563438f695.jpeg&quot; style=&quot;height:164px; width:162px&quot; /&gt;&lt;/p&gt;\r\n', '2019-03-18 13:52:58', '联系客服', '6', '', '');
INSERT INTO `ysk_wenzhang` VALUES ('17', '商家协议', '&lt;div style=&quot;text-align:center&quot;&gt;\r\n&lt;p&gt;&lt;strong&gt;&amp;ldquo;JAMMA加玛&amp;rdquo;商城商家入驻协议&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;甲方：&amp;ldquo;JAMMA加玛&amp;rdquo;商业联盟互助诚信商城&lt;/p&gt;\r\n\r\n&lt;p&gt;代理人：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;职级：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;电话：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;邮箱/微信/QQ号：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;乙方：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;地址：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;电话：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;邮箱/微信/QQ号：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;本协议由缔约双方在自愿、平等、公平及诚实信用原则的基础上，根据《中华人民共和国合同法》、《消费者权益保护法》等相关法律、法规的规定，经友好协商缔结。&lt;/p&gt;\r\n\r\n&lt;p&gt;本协议由协议正文、附件及依据本协议公示于甲方平台的各项规则所组成，协议附件及规则与本协议具有同等法律效力，如规则与本协议约定不一致的，以公布生效日期或签署日期在后的文件为准执行。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第一条 合作方式&lt;/p&gt;\r\n\r\n&lt;p&gt;1、商城合作形式&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;本协议所称合作，指由甲方所有并运营的&amp;ldquo;JAMMA加玛&amp;rdquo;商业联盟互诚信商城&amp;rdquo;提供电子商务平台并代收货款、由乙方提供商品并在甲方平台展示，同时由乙方自行向终端消费者提供商品、物流配送、售后服务等，双方联合经营的经营模式。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1.1甲方平台：指由甲方提供技术支持和服务的电子商务网站，由甲方提供技术服务或运营的移动端交易平台（包括但不限于甲方网APP、甲方PC平台等）。随着甲方服务范围或服务项目的变更，甲方可能在平台规则或公告中对甲方平台的范围或域名调整予以声明。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.2 用户：指使用甲方平台服务的自然人、法人或其他组织。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.3 商品：指在甲方平台上销售或展示的商品和服务。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.4 商家：指在甲方平台上出售或提供商品的用户（商标持有人资质等公司性质企业）。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.5 消费者：指在甲方平台上购买商品的用户。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.6 商家后台：商家在甲方平台经甲方审核及完成必要的入驻流程后，由甲方给予商家PC端的商家管理后台网址，包括独立的账号和平台设置的初始密码，商家在该后台完成产品编辑、上传、设置运费、处理订单、申请提现等相关事宜。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.7 确认交易：指消费者在爱国者诚信商城向乙方购买商品，通过爱国者诚信商城提供之后台系统付款并确认收货的交易。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.8 交易服务费：指甲方根据确认交易的商品价款向乙方收取的服务费用，此费用不包括网上支付涉及的银行交易手续费，也不涉及商品配送所产生的物流费用。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.9 平台规则：指在各甲方平台上已经发布或将来可能发布的各种规范性文件，包括但不限于《JAMMA商家入驻协议》及其他细则、规范、政策、通知等规范性文件。&lt;/p&gt;\r\n\r\n&lt;p&gt;1.10平台技术服务：以下或称&amp;ldquo;平台服务&amp;rdquo;，指甲方依托甲方平台向乙方提供的服务。主要包括店铺管理、商品发布、浏览、信息交流、商品交易、推广营销以及其他甲方各个平台上所提供的无偿或有偿的技术服务。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第二条 商家资格要求以及证明文件&lt;/p&gt;\r\n\r\n&lt;p&gt;1、乙方申请及开展店铺经营活动，须持续的同时满足以下基本条件：&lt;/p&gt;\r\n\r\n&lt;p&gt;（1）乙方已依照中华人民共和国法律注册并领取合法有效的营业执照及取得其他经营许可，身份信息应为商家自身情况的客观表现；&lt;/p&gt;\r\n\r\n&lt;p&gt;（2）乙方所经营的商品来源合法，资质齐全；&lt;/p&gt;\r\n\r\n&lt;p&gt;（3）乙方提交的任何信息均真实、合法、有效，所使用的图片、文字等不侵犯任何第三方合法权益；&lt;/p&gt;\r\n\r\n&lt;p&gt;（4）乙方签署本协议并同意甲方平台规则内容；&lt;/p&gt;\r\n\r\n&lt;p&gt;（5）甲方依据国家法律法规、政策或其他规范性文件规定及经营需要可能设定的其他条件。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、证明文件明细&lt;/p&gt;\r\n\r\n&lt;p&gt;（1）乙方应依据平台规则及相应的入驻流程要求完成甲方平台的入驻及店铺开设，在线签订甲方平台所公示的需要卖家签订的相应协议。乙方应向甲方提交各项为经营店铺所必须的资质、证照、证明或其他相关文件（以下统称&amp;ldquo;证明文件&amp;rdquo;），包括但不限于三证合一（营业执照、税务登记证、组织机构代码）、开户行证明、授权委托书、商标注册证、质检报告、法定代表人身份证正、反面复印件等，乙方应向甲方提交与原件核对一致且加盖乙方公章的纸质复印件（根据实际业务提供相应资质）。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;（2）乙方保证上述证明文件发生任何变更或更新时立即通知甲方，并于变更或更新之日起十五个工作日内，提交更新后的文件并依据甲方平台实时公布的流程进行相应认证。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;（3）乙方提交虚假、过期文件、或未如期通知并提交更新文件等情形的，由乙方独立承担全部法律责任。若由此导致乙方的店铺信息不符合甲方平台所公示的店铺认证条件的，甲方有权要求乙方补充提供相关资料，或者拒绝乙方申请、调整卖家权限、直至终止本协议。如乙方造成甲方及其他任何第三方损失的，乙方还应承担全部责任并足额赔偿。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第三条 费用以及付款&lt;/p&gt;\r\n\r\n&lt;p&gt;（1）甲方根据双方确认的商品结算价格向乙方结算货款（包含乙方自行设置向买家收取的邮寄费用）。&lt;/p&gt;\r\n\r\n&lt;p&gt;（2）货款自动结算周期为&lt;u&gt;&amp;nbsp;10 &lt;/u&gt;日（自乙方发货至消费者确认收货），结算日为结算周期届满的&lt;u&gt;&amp;nbsp;1 &lt;/u&gt;日后。甲方与乙方帐目未对清，乙方有权暂不结算。&lt;/p&gt;\r\n\r\n&lt;p&gt;（3）乙方自账户提现至银行账户时，每笔手续费为提款额的&lt;u&gt;&amp;nbsp;8 &lt;/u&gt;%，系统自动扣除。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第四条 双方权利义务&lt;/p&gt;\r\n\r\n&lt;p&gt;1、甲方在现有技术实现基础上努力维护甲方平台的正常稳定运行，并努力提升和改进技术，对平台功能及服务进行更新、升级，以不断提升平台性能和交易效率。如发现卖家有损系统安全、稳定操作的，甲方有权立即停止为乙方继续提供平台服务，并立即删除所有有害信息、数据等；乙方应对此导致的一切不利后果承担全部法律责任，包括但不限于赔偿甲方及其关联公司/机构、消费者或其他任何第三方的损失。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、甲方有权根据甲方平台的发展规划自主选择是否对通过资质审核的乙方开设店铺，提供平台服务。而未承诺必然对所有申请认证的卖家承诺开通权限；同时有权依据独立判断，不受时间限制的审批卖家的认证申请。&lt;/p&gt;\r\n\r\n&lt;p&gt;3、甲方有权单方根据国家相关法律法规、政策及甲方平台运营情况，对公示于甲方平台规则进行变更，变更后的规则甲方将以公告形式告知乙方，任何变更一经公告即构成本协议的组成部分。&lt;/p&gt;\r\n\r\n&lt;p&gt;4、甲方有权对乙方的申请信息、上传的相关数据信息、在甲方平台发布的其他信息、交易行为进行监督检查，对发现的涉嫌违反法律法规、违反平台规则或的信息及其相关内容，乙方知晓并同意甲方有权不经通知直接删除，对发现的其他问题或疑问卖家发出询问及要求改正的通知，乙方应在接到通知后立即做出说明并提供相关证明材料或改正。&lt;/p&gt;\r\n\r\n&lt;p&gt;5、甲方有权将国家生效法律文书或行政文书确定的乙方违法违规事件，或乙方已确认的乙方违反本协议相关约定的事项，在甲方平台上予以公示；卖家违规或者有严重违约、违规情形的，甲方有权对其采取限制权限、依据平台规则进行违规处理、扣除保证金直至终止本协议等措施，上述措施不足以补偿甲方及其关联公司/机构、消费者或其他任何第三方损失的，乙方还应足额赔偿。&lt;/p&gt;\r\n\r\n&lt;p&gt;6、如乙方的运营情况不能满足甲方平台公布的要求（包括但不限于甲方平台规则等），经限期整改调整后，仍无法满足的，甲方有权解除本协议，停止向乙方提供服务。&lt;/p&gt;\r\n\r\n&lt;p&gt;7、乙方有义务对其在甲方平台销售的每款商品按照国家标准，行业标准及甲方发布的各品类商品要求进行质量控制（包括且不仅限于商品法律法规符合性，商品安全性，商品功能材质与描述符合性，商品标识标示，商品外观，商品包装等），并依照国家法律法规提供售后三包服务。甲方有权根据市场反馈自行或委托第三方质检机构进行不定期商品抽检（检测项目包括且不仅限于乙方销售商品的性能，质量，材料成分，是否符合国家法律法规要求等各方面；抽检方式包括但不限于匿名购买、对于卖家订单信息及页面信息进行检查等），或要求乙方对甲方指定商品提供进货凭证，出厂检验报告或者第三方质检机构出具的检测报告等相关商品及批次的质量合格证明文件。如果乙方所销售商品抽检不合格或无法向甲方提供相关商品及批次质量合格的证明文件，甲方有权根据本协议及甲方平台所公示的平台规则，规范及标准，并且依据问题的严重程度对乙方提出相应的限期整改要求、进行违规处理以及追究相应的违约责任。&lt;/p&gt;\r\n\r\n&lt;p&gt;8、甲方有权要求乙方提供与乙方商品、售后服务等相关的信息，以便于消费者直接向甲方平台客服中心进行咨询时予以回复，对于甲方无法回答或属卖家掌握的情况，甲方有权要求乙方在指定的时限内予以回复或给出相应方案，如乙方未及时予以解决的客户咨询及投诉，甲方有权对乙方采取相应处理措施。&lt;/p&gt;\r\n\r\n&lt;p&gt;9、乙方同意甲方根据乙方营业执照所载明的经营范围及乙方申请的经营类目，核实及调整乙方在甲方平台经营的具体商品的种类、数量和类目范围。&lt;/p&gt;\r\n\r\n&lt;p&gt;10、如因乙方商品、发布的信息或提供的售后服务问题而引发客户对甲方及其关联公司/机构的诉讼，甲方及其关联公司/机构有权披露乙方为实际商品提供商，乙方应承担因诉讼而产生的全部法律责任，如因此而给甲方及其关联公司/机构造成损失的，甲方有权要求乙方赔偿甲方及其关联公司/机构的全部损失。&lt;/p&gt;\r\n\r\n&lt;p&gt;11、乙方同意并授权甲方代收买家货款，同时同意并授权甲方以甲方名义指令第三方支付机构将买家支付货款转账至甲方指定支付账户中，依据甲乙双方共同确认的结算流程，自买家确认收货后，将货款结算至乙方账户。&lt;/p&gt;\r\n\r\n&lt;p&gt;12、经双方约定并确认，乙方违反本协议时，应立即向甲方承担法律责任（包括但不限于支付违约金、赔偿金等），同时，甲方有权暂缓支付未结算款项；乙方进一步知悉并同意，在乙方未按时承担法律责任时，甲方有权直接自暂缓支付&lt;/p&gt;\r\n\r\n&lt;p&gt;13、乙方有义务按照买家实际支付的金额为买家开具发票，相关税收应按国家相关规定由商户自行承担。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第五条 保密义务&lt;/p&gt;\r\n\r\n&lt;p&gt;1、一方对于本协议的签订、内容及在履行本协议期间所获知的其他方的商业秘密负有保密义务。非经相对方书面同意，不得向相对方以外的任何第三方（关联公司除外）泄露、给予或转让该等保密信息。根据法律法规、证券交易所规则向政府、证券交易所和/或其他监管机构提供、协议方的法律、会计、商业及其他顾问、雇员除外）。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、如相对方提出要求，任何一方均应将载有相对方单独所有的保密信息的任何文件、资料或软件等，在本协议终止后按对方要求归还对方，或予以销毁，或进行其他处置，并且不得继续使用这些保密信息。&lt;/p&gt;\r\n\r\n&lt;p&gt;3、在本协议终止之后，各方在本条款项下的义务并不随之终止，各方仍需遵守本协议之保密条款，履行其所承诺的保密义务，直到其他方同意其解除此项义务，或事实上不会因违反本协议的保密条款而给其他方造成任何形式的损害时为止。&lt;/p&gt;\r\n\r\n&lt;p&gt;4、任何一方均应告知并督促其因履行本协议之目的而必须获知本协议内容及因合作而获知对方商业秘密的雇员、代理人、顾问等遵守保密条款，并对其雇员、代理人、顾问等的行为承担责任。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第六条 违约责任&lt;/p&gt;\r\n\r\n&lt;p&gt;1、乙方的经营导致纠纷或政府部门查处的，乙方应按甲方的要求提供相应的证明材料，必要时，应自行或由甲方协助或授权甲方及/或其关联公司/机构处理解决。由此导致的甲方及/或其关联公司/机构损失（损失包括但不限于诉讼费、律师费、赔偿、补偿、行政机关处罚、差旅费等），乙方应足额赔偿。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、乙方有销售假冒伪劣商品等侵犯知识产权行为、涉嫌非法信用卡套现等违法活动，并有可能涉嫌违法甚至刑事犯罪的，甲方有权向相应机关（包括但不限于行政监管机关、公安机关、司法机关以及其他有权机关）提供乙方一切资料及信息，在甲方平台披露乙方涉嫌违法及犯罪行为及情况，并配合相应机关的调查取证及侦查工作，乙方应承担由此产生的一切责任并赔偿甲方平台由此遭受的所有损失。&lt;/p&gt;\r\n\r\n&lt;p&gt;3、乙方违反乙方于本协议项下的陈述、承诺、保证和义务，或违反甲方平台规则以及乙方所在线签订的甲方平台所公示的在线协议，均构成对于本协议的违约。如乙方发生违约行为，甲方可以本协议约定的通知方式要求乙方在指定的时限内停止违约行为，要求其消除影响并依据平台规则对于乙方违约行为进行违规处理。乙方发生违约情形时，甲方除有权按照本协议约定要求乙方承担违约责任外，还有权依据本协议其他约定限制卖家权限、扣除保证金（如有）、解除本协议等措施。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第七条 通知及送达&lt;/p&gt;\r\n\r\n&lt;p&gt;1、针对乙方的服务费用收费标准变更、规则变更、保证金标准、通知等将以甲方平台公告形式告知卖家，公告一经发布，即视为送达，卖家应实时关注公告内容。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、甲方针对某特定卖家的通知等，将发送至卖家于&amp;ldquo;卖家在线认证页面&amp;rdquo;所填写的联系地址或者电子邮箱地址中；如以信函形式发送的，则以甲方发出之日起满三日视为已送达卖家；如以电子数据形式发送至卖家电子邮箱地址的，则甲方一经发出即视为送达。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第八条 争议解决&lt;/p&gt;\r\n\r\n&lt;p&gt;1、履行本协议过程中产生的任何争议，协议方应协商解决，协商不成的，任一方有权将争议提交本协议签订地有管辖权的法院诉讼解决。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、本协议的签订、解释、变更、履行及争议的解决等均适用中华人民共和国大陆地区现行有效的法律。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第九条 其他约定&lt;/p&gt;\r\n\r\n&lt;p&gt;1、本协议的任何一方未能及时行使本协议项下的权利不应被视为放弃该权利，也不影响该方在将来行使该权利。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、如果本协议中的任何条款无论因何种原因完全或部分无效或不具有执行力，或违反任何适用的法律，则该条款被视为删除，但本协议的其余条款仍应具有法律约束力。&lt;/p&gt;\r\n\r\n&lt;p&gt;3、本协议是缔约协议方之间关于本协议中提及合作事项的完整的、唯一的协议，本协议取代了任何先前的关于该合作事项的协议和沟通（包括数据电文形式、书面形式和口头形式）。&lt;/p&gt;\r\n\r\n&lt;p&gt;4、本协议文本以中华人民共和国通用简体汉字版本为准；乙方与甲方在线签订的《甲方平台非个人卖家服务协议》为本协议的一部分。&lt;/p&gt;\r\n\r\n&lt;p&gt;5、本协议自双方盖章之日起生效，壹式贰份，甲乙双方各执壹份，具有同等法律效力。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;第十条 协议有效期&lt;/p&gt;\r\n\r\n&lt;p&gt;1、本协议有效期&lt;u&gt;&amp;nbsp;1&lt;/u&gt;年，自&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;年&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;月&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;日至&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;年&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;月&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;日止。&lt;/p&gt;\r\n\r\n&lt;p&gt;2、本协议仅对乙方基于本协议而设立的特定店铺开展的相关业务具有法律约束力，不对甲方与乙方开展的同等或类似业务具有法律约束力，如甲方与乙方同时开展同等或类似业务，应依据另行签订的协议执行。&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;甲方：&amp;ldquo;JAMMA加玛&amp;rdquo;商业联盟互助诚信商城 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;乙方：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;（盖章） &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;（签名）&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;日期：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;年&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;月&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;日 &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;日期：&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;年&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;月&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;日&lt;/p&gt;\r\n&lt;/div&gt;\r\n', '2019-03-30 17:08:53', '商家协议', '9', '', '');
